INSERT INTO `cms_page` (`id`, `slug`, `title`, `content_json`, `meta_json`, `status`, `created_at`, `updated_at`, `deleted_at`, `draft_content`) VALUES
(1, 'home', 'Home', '<!-- =========================\n  UNIVERSITY HOME (ALT DESIGN) - NO HEADER\n  Responsive • Clean • More “campus” vibe\n========================== -->\n\n<!-- HERO (split + image block) -->\n<section id=\"home\" class=\"py-16 md:py-24\">\n  <div class=\"max-w-6xl mx-auto px-4 sm:px-6 lg:px-8\">\n    <div class=\"grid lg:grid-cols-12 gap-8 md:gap-12 items-center\">\n      <!-- Text -->\n      <div class=\"lg:col-span-6 space-y-6\">\n        <div class=\"inline-flex items-center gap-2 rounded-full border border-gray-200 dark:border-gray-800 px-3 py-1.5 text-sm text-gray-700 dark:text-gray-200\">\n          <span class=\"h-2 w-2 rounded-full bg-indigo-500\"></span>\n          Admissions 2025 • Applications open no disponible\n        </div>\n\n        <h1 class=\"text-4xl sm:text-5xl lg:text-6xl font-semibold tracking-tight text-gray-900 dark:text-gray-100 leading-tight\">\n          University Name\n          <span class=\"block mt-2 font-light\">\n            Excellence académique & recherche à impact\n          </span>\n        </h1>\n\n        <p class=\"text-base sm:text-lg text-gray-600 dark:text-gray-300 leading-relaxed max-w-xl\">\n          Formations innovantes, laboratoires reconnus, partenariats internationaux et vie de campus dynamique.\n          Préparez votre avenir avec une université connectée au monde.\n        </p>\n\n        <div class=\"flex flex-col sm:flex-row gap-3 sm:gap-4\">\n          <a href=\"#programs\"\n             class=\"inline-flex items-center justify-center px-6 py-3.5 rounded-xl bg-gray-900 dark:bg-gray-100 text-gray-100 dark:text-gray-900 font-medium hover:opacity-90 transition\">\n            Trouver une formation\n          </a>\n          <a href=\"#events\"\n             class=\"inline-flex items-center justify-center px-6 py-3.5 rounded-xl border border-gray-200 dark:border-gray-700 text-gray-800 dark:text-gray-200 font-medium hover:bg-gray-50 dark:hover:bg-gray-900 transition\">\n            Voir les évé