(2, 'platform', 'Plateform', '<!-- =========================\n  UNIVERSITY CMS LANDING (NO HEADER)\n  Better spacing + fully responsive\n  - Consistent section padding (py-16 md:py-24)\n  - Responsive container (px-4 sm:px-6 lg:px-8)\n  - Responsive grids + typography\n  - Safer spacing scales (gap-6 md:gap-10)\n========================== -->\n\n<!-- Hero -->\n<section id=\"home\" class=\"py-16 md:py-24 my-2\">\n  <div class=\"max-w-6xl mx-auto px-4 sm:px-6 lg:px-8\">\n    <div class=\"grid lg:grid-cols-2 gap-10 md:gap-14 items-center\">\n      <!-- Left -->\n      <div class=\"space-y-6 md:space-y-8\">\n        <span class=\"inline-flex items-center gap-2 px-3 py-1.5 bg-gray-100 dark:bg-gray-800 text-gray-700 dark:text-gray-200 rounded-full text-sm font-medium\">\n          <span class=\"inline-block h-2 w-2 rounded-full bg-emerald-500\"></span>\n          Innovation • Recherche • Réussite étudiante\n        </span>\n\n        <div class=\"space-y-4\">\n          <h1 class=\"text-4xl sm:text-5xl lg:text-6xl font-light tracking-tight text-gray-900 dark:text-gray-100 leading-tight\">\n            Une université tournée vers\n            <span class=\"block mt-2 font-normal\">l’apprentissage, la recherche et l’impact</span>\n          </h1>\n\n          <p class=\"text-base sm:text-lg text-gray-600 dark:text-gray-300 max-w-xl leading-relaxed\">\n            Découvrez nos formations, nos laboratoires, nos publications et une vie de campus dynamique.\n            Rejoignez une communauté qui construit l’avenir.\n          </p>\n        </div>\n\n        <div class=\"flex flex-col sm:flex-row gap-3 sm:gap-4\">\n          <a href=\"#academics\"\n             class=\"px-6 py-3.5 rounded-lg bg-gray-900 dark:bg-gray-100 text-gray-100 dark:text-gray-900 font-medium hover:opacity-90 transition text-center\">\n            Explorer les formations\n          </a>\n          <a href=\"#admissions\"\n             class=\"px-6 py-3.5 rounded-lg border border-gray-200 dark:border-gray-700 text-gray-800 dark:text-gray-200 font-medium hover:bg-gray-50 dark:hover:bg-gray-900 transition text-center\">\n            Admissions & Bourses\n          </a>\n        </div>\n\n        <!-- Stats (responsive) -->\n        <div class=\"grid grid-cols-1 sm:grid-cols-3 gap-3 sm:gap-4 max-w-xl\">\n          <div class=\"rounded-xl border border-gray-200 dark:border-gray-800 p-4\">\n            <p class=\"text-2xl font-semibold text-gray-900 dark:text-gray-100\">50+</p>\n            <p class=\"text-xs text-gray-500 dark:text-gray-400 mt-1\">Formations</p>\n          </div>\n          <div class=\"rounded-xl border border-gray-200 dark:border-gray-800 p-4\">\n            <p class=\"text-2xl font-semibold text-gray-900 dark:text-gray-100\">120+</p>\n            <p class=\"text-xs text-gray-500 dark:text-gray-400 mt-1\">Enseignants</p>\n          </div>\n          <div class=\"rounded-xl border border-gray-200 dark:border-gray-800 p-4\">\n            <p class=\"text-2xl font-semibold text-gray-900 dark:text-gray-100\">30+</p>\n            <p class=\"text-xs text-gray-500 dark:text-gray-400 mt-1\">Labs & Centres</p>\n          </div>\n        </div>\n      </div>\n\n      <!-- Right (Highlight Card) -->\n      <div class=\"lg:justify-self-end\">\n        <div class=\"rounded-2xl border border-gray-200 dark:border-gray-800 bg-gradient-to-b from-gray-50 to-white dark:from-gray-900/40 dark:to-gray-950 p-5 sm:p-6 shadow-sm\">\n          <div class=\"flex items-center justify-between gap-3\">\n            <p class=\"text-sm font-medium text-gray-900 dark:text-gray-100\">À la une</p>\n            <span class=\"text-xs px-2.5 py-1 rounded-full border border-gray-200 dark:border-gray-700 text-gray-600 dark:text-gray-300\">\n              Rentrée 2025\n            </span>\n          </div>\n\n          <div class=\"mt-5 space-y-3\">\n            <div class=\"rounded-xl border border-gray-200 dark:border-gray-800 p-4 bg-white/70 dark:bg-gray-950/30\">\n              <p class=\"text-sm font-semibold text-gray-900 dark:text-gray-100\">Journée portes ouvertes</p>\n              <p class=\"text-xs text-gray-500 dark:text-gray-400 mt-1\">Visite du campus • Rencontre des enseignants • Tour des labs</p>\n            </div>\n            <div class=\"rounded-xl border border-gray-200 dark:border-gray-800 p-4 bg-white/70 dark:bg-gray-950/30\">\n              <p class=\"text-sm font-semibold text-gray-900 dark:text-gray-100\">Bourses</p>\n              <p class=\"text-xs text-gray-500 dark:text-gray-400 mt-1\">Mérite • Social • Recherche</p>\n            </div>\n            <div class=\"rounded-xl border border-gray-200 dark:border-gray-800 p-4 bg-white/70 dark:bg-gray-950/30\">\n              <p class=\"text-sm font-semibold text-gray-900 dark:text-gray-100\">Recherche</p>\n              <p class=\"text-xs text-gray-500 dark:text-gray-400 mt-1\">Publications • Projets • Partenariats</p>\n            </div>\n          </div>\n\n          <div class=\"mt-6 grid grid-cols-1 sm:grid-cols-2 gap-3\">\n            <a href=\"#apply\"\n               class=\"text-center px-4 py-3 rounded-lg bg-gray-900 dark:bg-gray-100 text-gray-100 dark:text-gray-900 text-sm font-medium hover:opacity-90 transition\">\n              Candidater\n            </a>\n            <a href=\"#research\"\n               class=\"text-center px-4 py-3 rounded-lg border border-gray-200 dark:border-gray-700 text-gray-700 dark:text-gray-200 text-sm font-medium hover:bg-gray-50 dark:hover:bg-gray-900 transition\">\n              Explorer la recherche\n            </a>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</section>\n\n<!-- Academics -->\n<section id=\"academics\" class=\"py-16 md:py-24 border-t border-gray-100 dark:border-gray-800\">\n  <div class=\"max-w-6xl mx-auto px-4 sm:px-6 lg:px-8\">\n    <div class=\"text-center max-w-2xl mx-auto mb-10 md:mb-14\">\n      <h2 class=\"text-2xl md:text-3xl font-medium text-gray-900 dark:text-gray-100\">Formations</h2>\n      <p class=\"mt-3 text-gray-600 dark:text-gray-300\">\n        Des parcours clairs, une pédagogie moderne, et des compétences pour le monde réel.\n      </p>\n    </div>\n\n    <div class=\"grid sm:grid-cols-2 lg:grid-cols-3 gap-4 md:gap-6\">\n      <article class=\"group p-6 border border-gray-200 dark:border-gray-800 rounded-2xl hover:border-gray-300 dark:hover:border-gray-700 transition\">\n        <div class=\"flex items-start gap-4 mb-5\">\n          <div class=\"p-3 bg-blue-50 dark:bg-blue-900/20 rounded-lg group-hover:scale-105 transition-transform\">\n            <svg class=\"w-6 h-6 text-blue-600 dark:text-blue-400\" fill=\"none\" stroke=\"currentColor\" viewBox=\"0 0 24 24\">\n              <path stroke-linecap=\"round\" stroke-linejoin=\"round\" stroke-width=\"1.5\" d=\"M12 14l9-5-9-5-9 5 9 5z\"/>\n              <path stroke-linecap=\"round\" stroke-linejoin=\"round\" stroke-width=\"1.5\" d=\"M12 14l6.16-3.422a12.083 12.083 0 01.665 6.479A11.952 11.952 0 0012 20.944a11.952 11.952 0 00-6.824-3.886 12.083 12.083 0 01.665-6.479L12 14z\"/>\n            </svg>\n          </div>\n          <h3 class=\"text-lg font-medium text-gray-900 dark:text-gray-100\">Facultés & Écoles</h3>\n        </div>\n        <p class=\"text-sm text-gray-600 dark:text-gray-300 leading-relaxed\">\n          Ingénierie, Sciences, Droit, Gestion, Santé, Lettres… une organisation pensée pour l’excellence.\n        </p>\n        <a href=\"#\" class=\"inline-flex mt-4 text-sm font-medium text-gray-900 dark:text-gray-100 hover:underline\">Voir les facultés →</a>\n      </article>\n\n      <article class=\"group p-6 border border-gray-200 dark:border-gray-800 rounded-2xl hover:border-gray-300 dark:hover:border-gray-700 transition\">\n        <div class=\"flex items-start gap-4 mb-5\">\n          <div class=\"p-3 bg-emerald-50 dark:bg-emerald-900/20 rounded-lg group-hover:scale-105 transition-transform\">\n            <svg class=\"w-6 h-6 text-emerald-600 dark:text-emerald-400\" fill=\"none\" stroke=\"currentColor\" viewBox=\"0 0 24 24\">\n              <path stroke-linecap=\"round\" stroke-linejoin=\"round\" stroke-width=\"1.5\" d=\"M9 12h6m-6 4h6m2 5H7a2 2 0 01-2-2V5a2 2 0 012-2h7l5 5v12a2 2 0 01-2 2z\"/>\n            </svg>\n          </div>\n          <h3 class=\"text-lg font-medium text-gray-900 dark:text-gray-100\">Programmes & Parcours</h3>\n        </div>\n        <p class=\"text-sm text-gray-600 dark:text-gray-300 leading-relaxed\">\n          Licence, Master, Doctorat : parcours structurés, contenus actualisés et accompagnement pédagogique.\n        </p>\n        <a href=\"#\" class=\"inline-flex mt-4 text-sm font-medium text-gray-900 dark:text-gray-100 hover:underline\">Explorer les programmes →</a>\n      </article>\n\n      <article class=\"group p-6 border border-gray-200 dark:border-gray-800 rounded-2xl hover:border-gray-300 dark:hover:border-gray-700 transition\">\n        <div class=\"flex items-start gap-4 mb-5\">\n          <div class=\"p-3 bg-purple-50 dark:bg-purple-900/20 rounded-lg group-hover:scale-105 transition-transform\">\n            <svg class=\"w-6 h-6 text-purple-600 dark:text-purple-400\" fill=\"none\" stroke=\"currentColor\" viewBox=\"0 0 24 24\">\n              <path stroke-linecap=\"round\" stroke-linejoin=\"round\" stroke-width=\"1.5\" d=\"M8 7V3m8 4V3M5 11h14M5 21h14a2 2 0 002-2V7a2 2 0 00-2-2H5a2 2 0 00-2 2v12a2 2 0 002 2z\"/>\n            </svg>\n          </div>\n          <h3 class=\"text-lg font-medium text-gray-900 dark:text-gray-100\">Calendrier académique</h3>\n        </div>\n        <p class=\"text-sm text-gray-600 dark:text-gray-300 leading-relaxed\">\n          Dates de rentrée, inscriptions, examens, soutenances et événements : tout est centralisé.\n        </p>\n        <a href=\"#\" class=\"inline-flex mt-4 text-sm font-medium text-gray-900 dark:text-gray-100 hover:underline\">Voir le calendrier →</a>\n      </article>\n    </div>\n  </div>\n</section>\n\n<!-- Admissions -->\n<section id=\"admissions\" class=\"py-16 md:py-24 my-2\">\n  <div class=\"max-w-6xl mx-auto px-4 sm:px-6 lg:px-8\">\n    <div class=\"grid lg:grid-cols-2 gap-8 md:gap-12 items-start\">\n      <div class=\"space-y-6\">\n        <div class=\"space-y-3\">\n          <h2 class=\"text-2xl md:text-3xl font-medium text-gray-900 dark:text-gray-100\">Admissions & Inscriptions</h2>\n          <p class=\"text-gray-600 dark:text-gray-300 leading-relaxed max-w-xl\">\n            Des étapes simples, des critères transparents et un accompagnement complet de la candidature à l’inscription.\n          </p>\n        </div>\n\n        <div class=\"grid sm:grid-cols-2 gap-4\">\n          <div class=\"rounded-2xl border border-gray-200 dark:border-gray-800 p-5\">\n            <p class=\"text-sm font-semibold text-gray-900 dark:text-gray-100\">Licence</p>\n            <p class=\"text-sm text-gray-600 dark:text-gray-300 mt-2\">Conditions, dossier et frais.</p>\n          </div>\n          <div class=\"rounded-2xl border border-gray-200 dark:border-gray-800 p-5\">\n            <p class=\"text-sm font-semibold text-gray-900 dark:text-gray-100\">Master</p>\n            <p class=\"text-sm text-gray-600 dark:text-gray-300 mt-2\">Sélection, spécialités et calendrier.</p>\n          </div>\n          <div class=\"rounded-2xl border border-gray-200 dark:border-gray-800 p-5\">\n            <p class=\"text-sm font-semibold text-gray-900 dark:text-gray-100\">Doctorat</p>\n            <p class=\"text-sm text-gray-600 dark:text-gray-300 mt-2\">Écoles doctorales et encadrement.</p>\n          </div>\n          <div class=\"rounded-2xl border border-gray-200 dark:border-gray-800 p-5\">\n            <p class=\"text-sm font-semibold text-gray-900 dark:text-gray-100\">Bourses</p>\n            <p class=\"text-sm text-gray-600 dark:text-gray-300 mt-2\">Mérite, social, excellence & recherche.</p>\n          </div>\n        </div>\n\n        <div class=\"flex flex-col sm:flex-row gap-3 sm:gap-4\">\n          <a id=\"apply\" href=\"#\" class=\"px-6 py-3.5 rounded-lg bg-gray-900 dark:bg-gray-100 text-gray-100 dark:text-gray-900 font-medium hover:opacity-90 transition text-center\">\n            Déposer une candidature\n          </a>\n          <a href=\"#contact\" class=\"px-6 py-3.5 rounded-lg border border-gray-200 dark:border-gray-700 text-gray-800 dark:text-gray-200 font-medium hover:bg-gray-50 dark:hover:bg-gray-900 transition text-center\">\n            Contacter les admissions\n          </a>\n        </div>\n      </div>\n\n      <div class=\"rounded-2xl border border-gray-200 dark:border-gray-800 p-6 bg-gray-50/60 dark:bg-gray-900/20\">\n        <p class=\"text-sm font-semibold text-gray-900 dark:text-gray-100\">Checklist candidature</p>\n        <ul class=\"mt-4 space-y-3 text-sm text-gray-700 dark:text-gray-200\">\n          <li class=\"flex gap-3\"><span class=\"mt-1 h-2 w-2 rounded-full bg-gray-900 dark:bg-gray-100\"></span>Formulaire en ligne</li>\n          <li class=\"flex gap-3\"><span class=\"mt-1 h-2 w-2 rounded-full bg-gray-900 dark:bg-gray-100\"></span>Relevés de notes / diplômes</li>\n          <li class=\"flex gap-3\"><span class=\"mt-1 h-2 w-2 rounded-full bg-gray-900 dark:bg-gray-100\"></span>Lettre de motivation (si requise)</li>\n          <li class=\"flex gap-3\"><span class=\"mt-1 h-2 w-2 rounded-full bg-gray-900 dark:bg-gray-100\"></span>Recommandations (si requises)</li>\n          <li class=\"flex gap-3\"><span class=\"mt-1 h-2 w-2 rounded-full bg-gray-900 dark:bg-gray-100\"></span>Dossier bourse (optionnel)</li>\n        </ul>\n        <a href=\"#\" class=\"inline-flex mt-6 text-sm font-medium text-gray-900 dark:text-gray-100 hover:underline\">Télécharger le guide →</a>\n      </div>\n    </div>\n  </div>\n</section>\n\n<!-- Campus -->\n<section id=\"campus\" class=\"py-16 md:py-24\">\n  <div class=\"max-w-6xl mx-auto px-4 sm:px-6 lg:px-8\">\n    <div class=\"text-center max-w-2xl mx-auto mb-10 md:mb-14\">\n      <h2 class=\"text-2xl md:text-3xl font-medium text-gray-900 dark:text-gray-100\">Vie de campus</h2>\n      <p class=\"mt-3 text-gray-600 dark:text-gray-300\">Une communauté vivante : clubs, services, logement, sport et culture.</p>\n    </div>\n\n    <div class=\"grid sm:grid-cols-2 lg:grid-cols-3 gap-4 md:gap-6\">\n      <article class=\"p-6 border border-gray-200 dark:border-gray-800 rounded-2xl\">\n        <h3 class=\"text-lg font-medium text-gray-900 dark:text-gray-100\">Services aux étudiants</h3>\n        <p class=\"mt-2 text-sm text-gray-600 dark:text-gray-300\">Orientation, accompagnement, carrière, santé, aide sociale.</p>\n      </article>\n      <article class=\"p-6 border border-gray-200 dark:border-gray-800 rounded-2xl\">\n        <h3 class=\"text-lg font-medium text-gray-900 dark:text-gray-100\">Clubs & associations</h3>\n        <p class=\"mt-2 text-sm text-gray-600 dark:text-gray-300\">Tech, art, sport, entrepreneuriat, leadership, bénévolat.</p>\n      </article>\n      <article class=\"p-6 border border-gray-200 dark:border-gray-800 rounded-2xl\">\n        <h3 class=\"text-lg font-medium text-gray-900 dark:text-gray-100\">Logement & restauration</h3>\n        <p class=\"mt-2 text-sm text-gray-600 dark:text-gray-300\">Résidences, restauration, vie pratique sur le campus.</p>\n      </article>\n    </div>\n  </div>\n</section>\n\n<!-- News -->\n<section id=\"news\" class=\"py-16 md:py-24 border-t border-gray-100 dark:border-gray-800 my-2 py-2\">\n  <div class=\"max-w-6xl mx-auto px-4 sm:px-6 lg:px-8\">\n    <div class=\"flex flex-col md:flex-row md:items-end md:justify-between gap-4 mb-8 md:mb-10\">\n      <div class=\"max-w-2xl\">\n        <h2 class=\"text-2xl md:text-3xl font-medium text-gray-900 dark:text-gray-100\">Actualités & Événements</h2>\n        <p class=\"mt-3 text-gray-600 dark:text-gray-300\">Annonces, conférences, journées portes ouvertes, vie du campus.</p>\n      </div>\n      <a href=\"#\" class=\"text-sm font-medium text-gray-900 dark:text-gray-100 hover:underline\">Tout voir →</a>\n    </div>\n\n    <div class=\"grid sm:grid-cols-2 lg:grid-cols-3 gap-4 md:gap-6\">\n      <article class=\"p-6 border border-gray-200 dark:border-gray-800 rounded-2xl hover:bg-gray-50 dark:hover:bg-gray-900/30 transition\">\n        <p class=\"text-xs text-gray-500 dark:text-gray-400\">Événement • 2025</p>\n        <h3 class=\"mt-2 text-lg font-medium text-gray-900 dark:text-gray-100\">Colloque de recherche</h3>\n        <p class=\"mt-2 text-sm text-gray-600 dark:text-gray-300\">Journée de communications, posters et networking interdisciplinaire.</p>\n      </article>\n\n      <article class=\"p-6 border border-gray-200 dark:border-gray-800 rounded-2xl hover:bg-gray-50 dark:hover:bg-gray-900/30 transition\">\n        <p class=\"text-xs text-gray-500 dark:text-gray-400\">Actualité • 2025</p>\n        <h3 class=\"mt-2 text-lg font-medium text-gray-900 dark:text-gray-100\">Ouverture d’un nouveau laboratoire</h3>\n        <p class=\"mt-2 text-sm text-gray-600 dark:text-gray-300\">Renforcement des capacités en IA, data science et innovation.</p>\n      </article>\n\n      <article class=\"p-6 border border-gray-200 dark:border-gray-800 rounded-2xl hover:bg-gray-50 dark:hover:bg-gray-900/30 transition\">\n        <p class=\"text-xs text-gray-500 dark:text-gray-400\">Annonce • 2025</p>\n        <h3 class=\"mt-2 text-lg font-medium text-gray-900 dark:text-gray-100\">Résultats des bourses</h3>\n        <p class=\"mt-2 text-sm text-gray-600 dark:text-gray-300\">Les décisions de bourses sont disponibles sur le portail.</p>\n      </article>\n    </div>\n  </div>\n</section>\n\n<!-- Footer (optional) -->\n<footer class=\"py-10\">\n  <div class=\"max-w-6xl mx-auto px-4 sm:px-6 lg:px-8 border-t border-gray-100 dark:border-gray-800 pt-8 flex flex-col md:flex-row items-start md:items-center justify-between gap-4\">\n    <p class=\"text-sm text-gray-500 dark:text-gray-400\">© <span id=\"year\"></span> University Name. Tous droits réservés.</p>\n    <div class=\"flex flex-wrap gap-4 text-sm\">\n      <a href=\"#\" class=\"text-gray-600 dark:text-gray-300 hover:text-gray-900 dark:hover:text-gray-100 transition\">Confidentialité</a>\n      <a href=\"#\" class=\"text-gray-600 dark:text-gray-300 hover:text-gray-900 dark:hover:text-gray-100 transition\">Mentions légales</a>\n      <a href=\"#login\" class=\"text-gray-600 dark:text-gray-300 hover:text-gray-900 dark:hover:text-gray-100 transition\">Login</a>\n    </div>\n  </div>\n\n  <script>\n    document.getElementById(\"year\").textContent = new Date().getFullYear();\n  </script>\n</footer>\n', NULL, 'published', '2025-12-23 12:32:21', '2025-12-23 13:14:41', NULL, NULL);
